func cleanPath(dir string) string {
	dir = filepath.ToSlash(filepath.Clean(dir))

	if len(dir) == 1 {
		return dir
	}

	if dir[0] == '/' {
		dir = dir[1:]
	}

	size := len(dir)

	if size <= 1 {
		return dir
	}

	if dir[size-1] == '/' {
		dir = dir[:size-2]
	}

	return dir
}

